import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the featured products grid to load (using id selector)
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Find the first product card using XPath (div with class "product-card")
    const [firstProductCard] = await page.$x("//div[contains(@class, 'product-card')][1]");
    if (!firstProductCard) throw new Error('No product card found');

    // Scroll into view and click the first product card to open the modal
    await firstProductCard.scrollIntoViewIfNeeded();
    await firstProductCard.click();

    // Wait for the product modal to appear (using id selector)
    await page.waitForSelector('#productModal', { timeout: 5000 });

    // Wait for the modal to be visible (using style/display check)
    await page.waitForFunction(() => {
      const modal = document.getElementById('productModal');
      return modal && window.getComputedStyle(modal).display !== 'none';
    }, { timeout: 5000 });

    // Wait for the product detail content inside the modal
    await page.waitForSelector('#productDetail', { timeout: 5000 });

    // Take screenshot of the open modal
    const modalShot = path.join(screenshotsDir, 'step_2_product_modal_open.png');
    await page.screenshot({ path: modalShot });
    screenshots.push(modalShot);

    // Extract product title and price from the modal
    const extractedData = {};
    extractedData.productTitle = await page.$eval(
      '#productDetail .product-detail-title',
      el => el.textContent.trim()
    );
    extractedData.productPrice = await page.$eval(
      '#productDetail .product-detail-price',
      el => el.textContent.replace(/\s+/g, ' ').trim()
    );

    return {
      success: true,
      action: "Opened the product detail modal for the first product and extracted title and price.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
